package me.melo.cloud.usercenter.entity;import com.baomidou.mybatisplus.annotation.IdType;import com.baomidou.mybatisplus.annotation.TableId;import com.baomidou.mybatisplus.annotation.TableName;import java.io.Serializable;import java.time.LocalDateTime;import io.swagger.annotations.ApiModel;import io.swagger.annotations.ApiModelProperty;/** * <p> * 用户表 * </p> * * @author ljhua * @since 2022-08-08 */@TableName("sys_user")@ApiModel(value = "SysUser对象", description = "用户表")public class SysUser implements Serializable {    private static final long serialVersionUID = 1L;    @ApiModelProperty("主键")    @TableId(value = "id", type = IdType.AUTO)    private Long id;    @ApiModelProperty("租户id")    private Long tenantId;    @ApiModelProperty("账号")    private String account;    @ApiModelProperty("昵称")    private String nickname;    @ApiModelProperty("真实姓名")    private String realName;    @ApiModelProperty("1 : 男，0 : 女  -1：未知")    private String gender;    @ApiModelProperty("邮箱")    private String email;    @ApiModelProperty("电话")    private String mobile;    @ApiModelProperty("密码")    private String password;    @ApiModelProperty("'0'禁用，'1' 启用, '2' 密码过期或初次未修改")    private Integer status;    @ApiModelProperty("头像")    private String avatar;    @ApiModelProperty("国家")    private String country;    @ApiModelProperty("省")    private String province;    @ApiModelProperty("市")    private String city;    @ApiModelProperty("区")    private String area;    @ApiModelProperty("街道详细地址")    private String street;    @ApiModelProperty("备注")    private String comments;    @ApiModelProperty("创建者")    private Long createdBy;    @ApiModelProperty("创建时间")    private LocalDateTime createdTime;    @ApiModelProperty("更新者")    private Long modifiedBy;    @ApiModelProperty("更新时间")    private LocalDateTime modifiedTime;    @ApiModelProperty("1:删除 0:不删除")    private Integer delFlag;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public Long getTenantId() {        return tenantId;    }    public void setTenantId(Long tenantId) {        this.tenantId = tenantId;    }    public String getAccount() {        return account;    }    public void setAccount(String account) {        this.account = account;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public String getRealName() {        return realName;    }    public void setRealName(String realName) {        this.realName = realName;    }    public String getGender() {        return gender;    }    public void setGender(String gender) {        this.gender = gender;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public Integer getStatus() {        return status;    }    public void setStatus(Integer status) {        this.status = status;    }    public String getAvatar() {        return avatar;    }    public void setAvatar(String avatar) {        this.avatar = avatar;    }    public String getCountry() {        return country;    }    public void setCountry(String country) {        this.country = country;    }    public String getProvince() {        return province;    }    public void setProvince(String province) {        this.province = province;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }    public String getArea() {        return area;    }    public void setArea(String area) {        this.area = area;    }    public String getStreet() {        return street;    }    public void setStreet(String street) {        this.street = street;    }    public String getComments() {        return comments;    }    public void setComments(String comments) {        this.comments = comments;    }    public Long getCreatedBy() {        return createdBy;    }    public void setCreatedBy(Long createdBy) {        this.createdBy = createdBy;    }    public LocalDateTime getCreatedTime() {        return createdTime;    }    public void setCreatedTime(LocalDateTime createdTime) {        this.createdTime = createdTime;    }    public Long getModifiedBy() {        return modifiedBy;    }    public void setModifiedBy(Long modifiedBy) {        this.modifiedBy = modifiedBy;    }    public LocalDateTime getModifiedTime() {        return modifiedTime;    }    public void setModifiedTime(LocalDateTime modifiedTime) {        this.modifiedTime = modifiedTime;    }    public Integer getDelFlag() {        return delFlag;    }    public void setDelFlag(Integer delFlag) {        this.delFlag = delFlag;    }    @Override    public String toString() {        return "SysUser{" +            "id=" + id +            ", tenantId=" + tenantId +            ", account=" + account +            ", nickname=" + nickname +            ", realName=" + realName +            ", gender=" + gender +            ", email=" + email +            ", mobile=" + mobile +            ", password=" + password +            ", status=" + status +            ", avatar=" + avatar +            ", country=" + country +            ", province=" + province +            ", city=" + city +            ", area=" + area +            ", street=" + street +            ", comments=" + comments +            ", createdBy=" + createdBy +            ", createdTime=" + createdTime +            ", modifiedBy=" + modifiedBy +            ", modifiedTime=" + modifiedTime +            ", delFlag=" + delFlag +        "}";    }}